This seems to cause a new glitch in the simulator only when I call -reloadData. If we use the following code instead I don't see the glitch. I think it should accomplish the same result for the sort issue you were fixing:

    [CATransaction begin];
    [CATransaction setValue:(id)kCFBooleanTrue
                     forKey:kCATransactionDisableActions];
    cell.frame = frame;
    cell.contentView.frame = cell.bounds;
    [CATransaction commit];

To the person merging this in: Please note that this PR is supposed to go into `integration`, please **do not use the big, green "merge pull request" button**.

I suggest this branch is being `rebased` and `merge --no-ff`ed afterwards instead of doing a plain merge.

@a-ntoine We are generally implementing features against the `integration` branch. Only once a new version has been released the `master` branch catches up to it. The pull-request you've submitted is basically asking for us to pull your change into the wrong branch but it doesn't matter much since your change merges fine against `integration` as well.
